import React from "react";

function Ch({ onSubmit, childProps }) {

    console.log(childProps.id);
    
    function submit(e) {
        e.preventDefault();
        const a = "hello";
        onSubmit(a);
        
    }

    return (
        <>
            <button type="button" onClick={submit}>click</button>
        </>
    );
}

export default Ch;
